import { ucitajSveRazrede } from '../redux/odjeljenjaRazredi/actions';
import RazredRow from './RazredRow';
import { ucitajSveSkolskeGodine } from '../redux/skolskeGodine/actions';

const Razredi = () => {
  const razredi = useSelector((state) => state.razredi);
  const skolskeGodine = useSelector((state) => state.skolskeGodine.items);
  console.log(skolskeGodine);
  const dispatch = useDispatch();
  const navigate = useNavigate();

  useEffect(() => {
    if (skolskeGodine.length < 1) {
      dispatch(ucitajSveSkolskeGodine());
    }
  }, []);

  useEffect(() => {
    if (!razredi) {
      dispatch(ucitajSveRazrede());
    }
  }, []);

  return (
    <div>
      <button
        onClick={() => {
          navigate('/razredi/add-razred');
        }}
      >
        Add razred
      </button>
      {skolskeGodine.length > 0 &&
        skolskeGodine.items.map((sg) => {
          return (
            <select key={sg.idSkolskaGodina}>
              <option>{sg.skolskaGodina}</option>
            </select>
          );
        })}
